import React, {Component} from 'react';
// import {Link} from 'react-router-dom';
import Loader from "./Loader";

class Cell extends Component {
    constructor(props) {
        super(props);
        this.state = {
            data: null,
            isLoading: false,
            error: null,
        };
    };

    cellFunction(a, b){
        console.log(a, b);
    }

    render() {
        return (
            <div
                className="border"
                style={{height:"15px"}}
                onClick={
                    function(){
                        this.cellFunction(this.props.parent.val, this.props.val);
                    }
                }
            ></div>
        );
    }
}

export default Cell;
